/**
 * Enable state, county and city selectors on an HTML page
 * @param {string} stateSelectorId The ID of the select element for state on HTML page
 * @param {string} defaultState Default value of the state to be selected
 * @param {string} citySelectorId The ID of the select element for city on HTML page
 * @param {string} defaultCity Default value of the city to be selected
 */
function bindCitySelectors(stateSelectorId, defaultState, citySelectorId, defaultCity) {
  const stateSelector = document.getElementById(stateSelectorId);
  const citySelector = document.getElementById(citySelectorId);

  /**
   * Remove all the options of a select
   * @param {Object} sel HTML DOM Object of select
   */
  function clearSelectBox(sel) {
    while (sel.length > 0) {
      sel.remove(0);
    }
  }

  /**
   * Add an empty option to the select dropdown
   * @param {Object} sel HTML DOM Object of select
   */
  function addEmptyOption(sel) {
    const option = document.createElement('option');
    option.text = '';
    sel.add(option);
  }

  /**
   * Populate list of the options to the dropdown (select box)
   * @param {Object} sel HTML DOM Object of select
   * @param {Array} options An array of options which has name and value pairs
   * @param {String} selectedValue The value to be automatically selected in the dropdown
   */
  function populateOptions(sel, options, selectedValue) {
    if (!sel) {
      return;
    }
    clearSelectBox(sel);
    addEmptyOption(sel);
    let selectedIndex = 0;

    if (!options || !options.length) {
      return;
    }

    for (let i = 0; i < options.length; i++) {
      const op = options[i];
      const option = document.createElement('option');
      option.text = op.text;
      option.value = op.value;
      sel.add(option);
      if (selectedValue === op.value) {
        selectedIndex = i + 1;
      }
    }

    sel.selectedIndex = selectedIndex;
  }

  /**
   * List of options of the citys
   * @param {string} stateId Two-character state code
   */
  function getCityOptionsByStateId(stateId) {
    let cities = [];
    if (STATE_CITY_MAP[stateId]) {
      cities = STATE_CITY_MAP[stateId];
    }
    return cities.map((o) => {
      return {
        text: o,
        value: o,
      };
    });
  }

  populateOptions(
    stateSelector,
    STATES.map((st) => {
      return { text: st.stateName, value: st.stateId };
    }),
    defaultState
  );

  populateOptions(citySelector, getCityOptionsByStateId(defaultState), defaultCity);

  const selectors = {
    stateSelector,
    citySelector,
  };

  /**
   * When state selection is changed, re-populate the county dropdown with new values and clear city dropdown
   */
  function onStateChange() {
    const state = this.stateSelector.options[this.stateSelector.selectedIndex].value;
    const ops = getCityOptionsByStateId(state);
    // Populate cities by state
    populateOptions(this.citySelector, ops, '');
  }
  stateSelector.onchange = onStateChange.bind(selectors);
}
